import * as React from 'react';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Divider from '@mui/material/Divider';
import Chip from '@mui/material/Chip';
import FacebookLogin from 'react-facebook-login';
import FacebookRoundedIcon from '@mui/icons-material/FacebookRounded';
import { FacebookAuth, GoogleAuth, AppleAuth } from './oAuth/oAuthButtons'
import "./SignIn.css"
import { createTheme, ThemeProvider } from '@mui/material/styles';




export default function SignIn_form() {

    const handleSubmit = (event) => {
        event.preventDefault();
        const data = new FormData(event.currentTarget);
        console.log({
            email: data.get('email'),
            password: data.get('password'),
        });
    };

    const theme = createTheme();

    return (
        <ThemeProvider theme={theme}>
            <Container sx={{ p: "25px", border: '0px solid #636E51' }} component="main">
                <Grid container spacing={1}>
                    <Grid item xs={6} md={6} sx={{ mt: "40px" }}>
                        <Box>
                            <Typography
                                variant="h3"
                                style={{ fontFamily: 'Kalam' }}
                                noWrap
                                sx={{
                                    display: { xs: 'none', md: 'flex' }, fontWeight: 300,
                                    color: '#Cb6605',
                                    textDecoration: 'none'
                                }}
                            >
                                Join the susita community<br />
                                make connections<br />
                                and rev up your passion
                            </Typography>
                        </Box>
                        <Box
                            sx={{
                                width: "420px",
                                marginTop: 0,
                                display: 'flex',
                                flexDirection: 'column',
                                alignItems: 'left',
                            }}
                        >
                            <Box component="form" onSubmit={handleSubmit} noValidate sx={{ mt: 1 }}>
                                <TextField
                                    margin="normal"
                                    required
                                    fullWidth
                                    id="email"
                                    label="Email, phone number or license plate"
                                    name="email"
                                    autoComplete="email"
                                    autoFocus
                                />
                                <TextField
                                    margin="normal"
                                    required
                                    fullWidth
                                    name="password"
                                    label="Password"
                                    type="password"
                                    id="password"
                                    autoComplete="current-password"
                                />
                                <Button
                                    style={{ borderRadius: '30px' }}
                                    type="submit"
                                    variant="text"
                                    sx={{ mt: 0, mb: 0 }}
                                >
                                    Forgot password?
                                </Button>
                                <Button
                                    style={{ borderRadius: '30px' }}
                                    type="submit"
                                    fullWidth
                                    variant="contained"
                                    sx={{ mt: 1, mb: 2 }}
                                >
                                    Sign In
                                </Button>
                                <Divider sx={{ borderWidth: 10, mb: '1000px' }}>
                                    <Typography
                                        variant="h6"
                                        sx={{
                                            fontSize: 15.5, fontFamily: 'Open Sans', fontWeight: 300,
                                            letterSpacing: '.0.5rem', textTransform: 'none',
                                            display: { xs: 'none', md: 'flex' },
                                            color: '#949494',
                                            textDecoration: 'none'
                                        }}
                                    >
                                        or sign in with
                                    </Typography>
                                </Divider>
                                <Box sx={{
                                    display: 'flex',
                                    flexDirection: 'row',
                                    alignItems: 'center',
                                    justifyContent: 'center'
                                }}>
                                    <FacebookAuth/>
                                    <GoogleAuth />
                                </Box>
                            </Box>
                        </Box>
                    </Grid>
                    <Grid item xs={6} md={6} container justify="center" alignItems="center" >
                        <img src=".\signIn.png" style={{ marginTop: '0px' }} width={'650px'} height='auto' />
                    </Grid>
                </Grid>
            </Container>
        </ThemeProvider>
    );
}
